function tick(game){
  if (game.step % 15 === 0){  
    if (game.ships.length !== 0){
      var max = Math.max(12,Math.min(27,~~(game.ships.length*2.2)));
      if (game.aliens.length < max){
        var spawn_delay = game.step / ~~(1800 / 1.5 * 2);
        var alien = alien_types[~~(Math.random()*Math.min(alien_types.length,spawn_delay/4))];
        alien.x = Math.cos(Math.random()*Math.PI*2)*45;
        alien.y = Math.sin(Math.random()*Math.PI*2)*45;
        game.addAlien(alien);
      }
    }
  }
  if (game.step % 20 === 0){
    for (let alien of game.aliens){
      if (Math.abs(alien.x) > alien_radius || Math.abs(alien.y) > alien_radius){
        if (alien.code != 16){      
          alien.set({x:Math.cos(Math.random()*Math.PI*2)*5,y:Math.sin(Math.random()*Math.PI*2)*5});
        }
      }
    }
  }
  if (game.step % 60 === 0){
    for (let ship of game.ships){
      if (ship.team === 0) ship.custom.status_hue = "#b5eae2";
        else
      if (ship.team === 1) ship.custom.status_hue = "#cdb3fd";
      if (ship.healing === true){
        ship.custom.status_text = "You are in healing mode ";
        status_button(ship,20,true);
      } else {
        ship.custom.status_text = "You are in offensive mode ";
        status_button(ship,22,true);
      }
      if (!ship.custom.radar){
        ship.custom.radar = true;
        ship.setUIComponent(radar_background);
      }
    } 
    if (game.step % 3600/1.5 === 0) game.addCollectible({code:10,x:Math.cos(Math.random()*Math.PI*2)*50,y:Math.sin(Math.random()*Math.PI*2)*50});
    if (game.step % 3600*2.2 === 0) game.addCollectible({code:11,x:Math.cos(Math.random()*Math.PI*2)*50,y:Math.sin(Math.random()*Math.PI*2)*50});
    if (game.step % 3600*1.5 === 0) game.addCollectible({code:21,x:Math.cos(Math.random()*Math.PI*2)*50,y:Math.sin(Math.random()*Math.PI*2)*50});
  }    
  if (game.step % 600 === 0) button(26.5,10,60,25,"quote",false,true,quotes[~~(quotes.length*Math.random())]);
}

var alien_radius = 0.25;  
 
function game_start(game){
  alien_radius = alien_radius * game.options.map_size * 5; 
  this.tick = tick;
}
this.tick = game_start;
 
game.modding.tick = function(t){
  this.game.tick(t);
  if (this.context.tick != null){
    this.context.tick(this.game);
  } 
};  

game.modding.commands.a = function(){
  for (let alien of game.aliens){
    alien.set({kill:true});
  }
  echo("Aliens cleared");
};

this.event = function(event, game){
  switch (event.name){
    case "alien_destroyed":
      const alien = event.alien;
      if (alien.code == 10 && alien.level === 1){
        for (let i = 0; i<2; i++) game.addAlien({code:10,level:0,x:alien.x+alien.vy*3,y:alien.y+alien.vx*3,vx:-1*alien.vy,vy:alien.vx,crystal_drop:7,points:5});
      }
      else if (alien.code == 10 && alien.level === 2){
        for (let i = 0; i<4; i++) game.addAlien({code:10,level:0,x:alien.x+alien.vy*3,y:alien.y+alien.vx*3,vx:-1*alien.vy,vy:alien.vx,crystal_drop:7,points:5});
      }
      else if (alien.code == 10 && alien.level === 3){
        for (let i = 0; i<4; i++){    
          let spread = 4;
          let x = alien.x + Math.random()*spread*3-spread;
          let y = alien.y + Math.random()*spread*3-spread;
          game.addAlien({code:10,level:1,x:x,y:y,vx:-1*alien.vy,vy:alien.vx,crystal_drop:15,points:15});
        }
        for (let i = 0; i<6; i++){
          let spread = 4;
          let x = alien.x + Math.random()*spread*3-spread;
          let y = alien.y + Math.random()*spread*3-spread;            
          game.addAlien({code:10,level:0,x:x,y:y,vx:-1*alien.vy,vy:alien.vx,crystal_drop:7,points:5});
        }
      }
      else if (alien.code == 16 && alien.level === 1){
        for (let i = 0; i<2; i++) game.addAlien({code:16,level:0,x:alien.x+alien.vy*3,y:alien.y+alien.vx*3,vx:-1*alien.vy,vy:alien.vx,crystal_drop:24,points:20});
      } 
    break;
  }
};

